import React from "react";
import AddFishFrom from "./AddFishForm";

class Inventory extends React.Component {
  render() {
    return (
      <div className="inventory">
        <h1>Inventory!!!</h1>
        <AddFishFrom />
      </div>
    );
  }
}

export default Inventory;
